(6, 'IGNITION 3.0', 'REG_16694191001969', '<p>Ignition 3.0, themed - FEED THE NATION, is set at build up people who will feed other people.</p><p>Just like the little lad with the five loaves of bread and two fishes, he recognized early that what he has been given was not meant for him alone but for others too, he surrendered it at Jesus feet and Jesus fed the multitudes with it.</p><p>We are set to remind and bring people to understanding that they are not empty, they can also feed the nations.</p><p>This conference - IGNITION 3.0 is a certain move to raise giants who would go and raise other giants.</p>', NULL, NULL, 'uploads/16694191003090386IMG_20221124_WA0012.jpg', '1609528740i5nm3eaclle988tr2m39eau31', '11:31:40', '2022-11-25', 'thumb/1669419100263265IMG_20221124_WA0012.jpg', 0, NULL, NULL, 'Comelymhe Impact Network ', NULL, 'Comelymhe Impact Network ', NULL, 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ignition3', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'IGNITION 3.0', 'REG_16694191836894', '<p>Ignition 3.0, themed - FEED THE NATION, is set at build up people who will feed other people.</p><p>Just like the little lad with the five loaves of bread and two fishes, he recognized early that what he has been given was not meant for him alone but for others too, he surrendered it at Jesus feet and Jesus fed the multitudes with it.</p><p>We are set to remind and bring people to understanding that they are not empty, they can also feed the nations.</p><p>This conference - IGNITION 3.0 is a certain move to raise giants who would go and raise other giants.</p>', NULL, NULL, 'uploads/16694191833069033IMG_20221124_WA0012.jpg', '1609528740i5nm3eaclle988tr2m39eau31', '11:33:03', '2022-11-25', 'thumb/16694191838193172IMG_20221124_WA0012.jpg', 0, NULL, NULL, 'Comelymhe Impact Network ', NULL, NULL, NULL, 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ignition3', NULL, NULL, 6, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
