(10, 'Demo Naija Whiskey Spirits Festival', 'REG_16750923271385', '<p>The Naija Whiskey Spirits Festival is an event to celebrate the world\'s finest whiskeys and spirits in the Nigerian market. This event, which will be a daylong celebration, will also afford the participants the opportunity to know more about the finest drinks and interact with the brains behind these brands in an atmosphere of sights, sounds, colors, lifestyle, and culture in&nbsp;a&nbsp;festive&nbsp;mood.</p>', NULL, NULL, 'uploads/16750925095282534naija_whiskey_spirisdfghjkt_2.jpg', '5Tuol327710328', '03:25:27', '2023-01-30', 'uploads/16750925095282534naija_whiskey_spirisdfghjkt_2.jpg', 0, NULL, NULL, 'Party Monkz Entertainment', NULL, NULL, NULL, 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-02-28', NULL, 500, NULL, '1', 'demo-naija-whiskey-spirits-festival', NULL, NULL, 4, NULL, 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'Call For Mentor ', 'REG_16761483452106', '<h3><strong>Become a Mentor</strong></h3><p>Are you eager to support aspiring professionals, diversity, and inclusion efforts, or for another service opportunity? Or perhaps you are looking for an opportunity to gain some mentoring experience. Look no further!</p><p>CAMP provides unique mentoring opportunities as it allows you to mentor individuals outside of your niche, and possibly country. CAMP &nbsp;is offering a mentorship program to assist undergradute in finding mentors, and to aid mentors in finding interested students.</p><h3><strong>Why You Should Sign-Up&nbsp; </strong>&nbsp;&nbsp;&nbsp;</h3><ul><li>Give back to the community and make a positive impact.</li><li>Enhance your leadership and communication skills.</li><li>Expand your professional network.</li><li>Stay current with industry trends and developments.</li><li>Feel a sense of fulfillment and purpose in your professional life.</li><li>And being a mentor at a conference is an opportunity to gain experience for future mentoring opportunities</li></ul><p>&nbsp;</p>', NULL, NULL, 'uploads/16761483453357646WhatsApp_Image_2023_02_09_at_10.16.11_AM.jpeg', '1537374982obusn6a8u39t94101n5ol', '08:45:45', '2023-02-11', 'thumb/16761483453025384WhatsApp_Image_2023_02_09_at_10.16.11_AM.jpeg', 0, NULL, NULL, 'TheSoftLife', NULL, NULL, NULL, 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2023-03-03', NULL, 1345, NULL, NULL, 'CAMPMENTOR', NULL, NULL, 4, NULL, 'free', NULL, NULL, NULL, NULL, 'a:4:{s:28:\"V2hhdCBpcyB5b3VyIHN0YXR1cz8=\";a:5:{s:2:\"id\";s:28:\"V2hhdCBpcyB5b3VyIHN0YXR1cz8=\";s:8:\"question\";s:20:\"What is your status?\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:3:{i:0;s:22:\"1-2 year professional \";i:1;s:22:\"3-4 year professional \";i:2;s:20:\"4+ year professional\";}s:8:\"required\";b:1;}s:36:\"SW5zdGl0dXRpb24vV29ya3BsYWNlIE5hbWU=\";a:5:{s:2:\"id\";s:36:\"SW5zdGl0dXRpb24vV29ya3BsYWNlIE5hbWU=\";s:8:\"question\";s:26:\"Institution/Workp