(16, 'Mckodev Testing', 'REG_16794046745137', '<p>Environment: Refers to the natural and physical surroundings, including living and non-living things, such as air, water, land, plants, and animals.</p><p>Extreme Weather Events: Refers to the occurrence of unusual and severe weather conditions, such as floods, droughts, hurricanes, and heatwaves, that can cause significant damage to infrastructure and human lives.</p><p>Rainfall Patterns: Refers to the variation in the frequency, amount, and distribution of precipitation in a particular area over a period of time.</p>', NULL, NULL, 'uploads/1679404674466319Couple_Testing.JPG', '16762792563mt5riglkc75e14t6nsvt4o7ca2eeid', '01:17:54', '2023-03-21', 'thumb/16794046744347443Couple_Testing.JPG', 0, NULL, NULL, 'Mr Tester', '<p>Environment: Refers to the natural and physical surroundings, including living and non-living things, such as air, water, land, plants, and animals.</p><p>Extreme Weather Events: Refers to the occurrence of unusual and severe weather conditions, such as floods, droughts, hurricanes, and heatwaves, that can cause significant damage to infrastructure and human lives.</p><p>Rainfall Patterns: Refers to the variation in the frequency, amount, and distribution of precipitation in a particular area over a period of time.</p>', '@mckodev', '@mckodev', 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-03-31', NULL, 2000, NULL, '1', 'angelwings', NULL, NULL, 5, NULL, 'paid', 'single', '2000', NULL, NULL, 'a:1:{s:12:\"QWRkcmVzcw==\";a:5:{s:2:\"id\";s:12:\"QWRkcmVzcw==\";s:8:\"question\";s:7:\"Address\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}}', NULL, NULL, NULL, 'a:1:{s:20:\"QWRlZGF5byBBZmVlemU=\";a:2:{s:2:\"id\";s:20:\"QWRlZGF5byBBZmVlemU=\";s:8:\"marketer\";s:14:\"Adedayo Afeeze\";}}', 'NGN', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
