(26, 'EKITI GOT TALENT SEASON 3', 'REG_16910632342881', '<p>It feels like yesterday when we kicked off the first edition of EGT.</p><p>EGT was borne out of the passion to celebrate unique talent and to revive the value &nbsp;and &nbsp;potential &nbsp;of our their state.</p><p>1.0 happened in 2018<br>2.0 happened in 2019</p><p><strong>And now BIGger and beTTER we are setting up the STAGE as a stepping stone for Talents in Ekiti to Achieve...</strong></p><p><strong>their MOMENT OF FAME!</strong></p><p><br><i>#Anticipate #3.0 #MomentOfFame #EkitiGotTalent</i></p>', NULL, NULL, 'uploads/1691064746326292023_EGT_3.0_B..jpg', '1691062225_5742683', '11:47:14', '2023-08-03', 'uploads/1691064746326292023_EGT_3.0_B..jpg', 0, NULL, NULL, 'Awesome Laff Management ', '<p><strong>AWESOME LAFF MANAGEMENT </strong>has organized events with good records</p>', 'Ekiti Got Talent', 'ekitigottalent', 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-09-02', NULL, 200, NULL, NULL, 'ekitigottalent', NULL, NULL, 21, '', 'paid', 'single', '5000', NULL, NULL, 'a:6:{s:4:\"QWdl\";a:5:{s:2:\"id\";s:4:\"QWdl\";s:8:\"question\";s:3:\"Age\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:12:\"QWRkcmVzcw==\";a:5:{s:2:\"id\";s:12:\"QWRkcmVzcw==\";s:8:\"question\";s:7:\"Address\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:20:\"VGFsZW50IENhdGVnb3J5\";a:5:{s:2:\"id\";s:20:\"VGFsZW50IENhdGVnb3J5\";s:8:\"question\";s:15:\"Talent Category\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:24:\"SW5zdGl0dXRpb24vU2Nob29s\";a:5:{s:2:\"id\";s:24:\"SW5zdGl0dXRpb24vU2Nob29s\";s:8:\"question\";s:18:\"Institution/School\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:16:\"TmF0aW9uYWxpdHk=\";a:5:{s:2:\"id\";s:16:\"TmF0aW9uYWxpdHk=\";s:8:\"question\";s:11:\"Nationality\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:48:\"V2hpY2ggU3RhdGUgQXJlIFlvdSBSZWdpc3RlcmluZyBGcm9t\";a:5:{s:2: