(44, 'Media Accreditation Form', 'REG_17215815466582', '<p>Welcome to the Osun Osogbo International Festival 2024 Media Accreditation process. We deeply value the enthusiasm and support from the media, influencers, and the community. To ensure a cohesive and respectful representation of our cultural heritage, we have outlined the guidelines and requirements for media coverage.</p><p>&nbsp;</p><p>Purpose of Media Accreditation</p><p>Our primary aims for this accreditation process are:</p><p>&nbsp;</p><p>1. Understanding the Purpose of Media Usage:</p><p>&nbsp;&nbsp;&nbsp;&nbsp;- We seek to understand how media houses intend to use festival materials, particularly for commercial purposes.</p><p>&nbsp;</p><p>2. Respecting Traditional and Sacred Elements:</p><p>&nbsp;&nbsp;&nbsp;&nbsp;- Attention Media Partners, Please be advised that there are specific sacred elements of the festival that must not be photographed or recorded. For further clarification on this matter, we encourage you to reach out to us at media@osunosogbofestival.com or by calling the contact numbers provided below.<br><br><strong>Media Accreditation Form</strong></p>', NULL, NULL, '2024/07/21/uploads/172158154568860121714337291864.jpg', 'j90819542aBn72i', '05:05:46', '2024-07-21', '2024/07/21/uploads/172158154568860121714337291864.jpg', 0, NULL, NULL, 'Osun Osogbo', '<p>Osun Osogbo</p>', NULL, NULL, 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2024-08-23', NULL, 20000, NULL, NULL, 'osunosogbomedia', NULL, NULL, 18, '', 'free', NULL, NULL, NULL, NULL, 'a:17:{s:40:\"TWVkaWEgSG91c2UvT3JnYW5pemF0aW9uIE5hbWU=\";a:5:{s:2:\"id\";s:40:\"TWVkaWEgSG91c2UvT3JnYW5pemF0aW9uIE5hbWU=\";s:8:\"question\";s:29:\"Media House/Organization Name\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:20:\"VHlwZSBvZiBNZWRpYSA=\";a:6:{s:2:\"id\";s:20:\"VHlwZSBvZiBNZWRpYSA=\";s:8:\"question\";s:14:\"Type of Media \";s:4:\"type\";s:8:\"multiple\";s:7:\"options\";a:5:{i:0;s:3:\" Tv\";i:1;s:6:\" Radi