(45, 'IGNITION 5.0', 'REG_17272757297741', '<p>The theme of IGNITION 5.0 is \"KINGS AND PRIESTS\" as seen in Revelation 1:6.</p><p>The purpose of this event is to cause an ignition in youths and young adults to the knowledge of their Place and Identity as Kings and priests in this world.</p><p>We shall cover aspects around purpose, relationship, academics, business and there shall be impartations.</p><p>IGNITION 5.0 is a time of massive impartation.</p><p>Don\'t&nbsp;miss&nbsp;it.<br><br><br><strong>REGISTER NOW!!!</strong></p>', NULL, NULL, '2024/09/25/uploads/17272757286035566Kings_and_Priests_Ignition_5.0_i.jpg', '1609528740i5nm3eaclle988tr2m39eau31', '02:48:49', '2024-09-25', '2024/09/25/uploads/17272757286035566Kings_and_Priests_Ignition_5.0_i.jpg', 0, NULL, NULL, 'Comelymhe Impact Network ', '<p>Comelymhe Impact Network is a dynamic, multi-faceted organization dedicated to holistic growth, focusing on personal development, love, relationships, purpose discovery, marriage, Academic excellence, and business development.</p><p>It serves as a transformative platform, equipping individuals to thrive in these critical areas.</p><p>Through strategic initiatives, events and resources such as Ignition, Media trainings and Academy, consultation and counseling etc. the network empowers people to lead fulfilled lives, build meaningful relationships, find and pursue their purpose, cultivate strong, purpose-driven marriages, excel academically, and develop successful businesses.</p><p>The goal is to foster growth, impact, and sustainable success in every&nbsp;sphere&nbsp;of&nbsp;life.</p>', NULL, NULL, 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'IGNITION5', NULL, NULL, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Thank you for registering... See you at IGNITION 5.O</p>', NULL, NULL, NULL, NULL),
