(47, 'Business Development Associate ', 'REG_17342668458962', '<h3>Business Development Associate&nbsp;</h3><p><strong>Job Title:</strong>&nbsp; Business Development Associate<br><strong>Location:</strong>&nbsp;Ado-Ekiti, Ekiti.<br><strong>Department:</strong> Sales &amp; Marketing</p><p>Duration:&nbsp;6 months (with potential for extension)</p><p><strong>About McKodev Tech Lab:&nbsp;</strong>McKodev Tech Lab is a registered Web Development Agency focused on delivering quality solutions and achieving exceptional results for our clients. We specialize in creating innovative websites and digital solutions that empower businesses to thrive online. Our core values of quality, collaboration, and customer satisfaction drive our success.</p><p><strong>Position Overview:&nbsp;</strong>We are seeking a proactive and results-driven Business Development Associate to join our dynamic team. This role involves identifying business opportunities, developing strategic partnerships, and helping to expand our client base. The ideal candidate will have a strong understanding of the web development industry and be passionate about growing a business through effective relationship management and sales strategies.<br>&nbsp;</p><p><strong>Key Responsibilities:</strong></p><ul><li>Research and identify new business opportunities and markets for web development services.</li><li>Build and maintain strong relationships with prospective and current clients.</li><li>Assist in developing and executing strategic business plans to achieve company growth objectives.</li><li>Collaborate with the&nbsp; teams to generate leads and convert them into sales.</li><li>Conduct presentations and product demonstrations to potential clients.</li><li>Manage sales inquiries, follow up on leads, and close deals to meet sales targets.</li><li>Maintain a detailed CRM database of all business development activities.</li><li>Analyze market trends and competitor offerings to provide feedback and recommendations for improvements.</li><li>Participate in industry events, conferences, and networking opportunities to promote the company’s services.</li></ul><p><strong>Qualifications:</strong></p><ul><li>Bachelor’s degree in Business, Marketing, or a related field (preferred).</li><li>A year of experience in business development, sales, or marketing.</li><li>Strong communication, negotiation, and interpersonal skills.</li><li>Self-motivated, results-oriented, and able to work independently.</li><li>Proficiency in CRM software and Microsoft Office Suite.</li><li>Excellent organizational and time-management skills.</li></ul>', NULL, NULL, '2024/12/15/uploads/17342668456721153DALL__E_2024_12_15_13.46.42___An_illustration_depicting_recruitment__featuring_diverse_professionals_in_a_modern_office_setting._A_hiring_manager_sits_at_a_desk_reviewing_resumes_w.webp', 'j90819542aBn72i', '12:47:25', '2024-12-15', '2024/12/15/uploads/17342668456721153DALL__E_2024_12_15_13.46.42___An_illustration_depicting_recruitment__featuring_diverse_professionals_in_a_modern_office_setting._A_hiring_manager_sits_at_a_desk_reviewing_resumes_w.webp', 0, NULL, NULL, 'Mckodev Tech Lab', '<p>McKodev Tech Lab is a registered Web Development Agency focused on delivering quality solutions and achieving exceptional results for our clients. We specialize in creating innovative websites and digital solutions that empower businesses to thrive online. Our core values of quality, collaboration, and customer satisfaction drive our success.</p>', NULL, NULL, 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2024-12-31', NULL, 50, NULL, NULL, 'bsa', NULL, NULL, 18, '', 'free', NULL, NULL, NULL, NULL, 'a:3:{s:68:\"QXJlIHlvdSBhIHJlY2VudCBncmFkdWF0ZSAoMS0yeXJzIHBvc3QgZ3JhZHVhdGlvbikg\";a:6:{s:2:\"id\";s:68:\"QXJlIHlvdSBhIHJlY2VudCBncmFkdWF0ZSAoMS0yeXJzIHBvc3QgZ3JhZHVhdGlvbikg\";s:8:\"question\";s:51:\"Are you a recent graduate (1-2yrs post graduation) \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:3:\"Yes\";i:1;s:2:\"No\";}s:8:\"required\";b:1;s:7:\"specify\";b:0;}s:12:\"TG9jYXRpb24=\";a:5:{s:2:\"id\";s:12:\"TG9jYXRpb24=\";s:8:\"question\";s:8:\"Location\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:56:\"Q1YgKFBsZWFzZSBzaG91bGQgbm90IGJlIG1vcmUgdGhhbiAxME1CKSAq\";a:5:{s:2:\"id\";s:56:\"Q1YgKFBsZWFzZSBzaG91bGQgbm90IGJlIG1vcmUgdGhhbiAxME1CKSAq\";s:8:\"question\";s:42:\"CV (Please should not be more than 10MB) *\";s:4:\"type\";s:5:\"image\";s:7:\"options\";b:0;s:8:\"required\";b:1;}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Thank you for registering. Please note that you will be contacted if you are shortlisted for interview</p>', NULL, '4bxZL1hgCL+bCQSMqV5ZqwguZjg9JYCYqRgRENCXu12oHOL7+TJemVWx8yKDYdXBOEPbBVDgl0Wu40LtLNk3Ta8Ns23F3HIf55fSHUUwMdlZrjiqtMRyGKgSF52coUvwdow99AKwHDnK3S1rL41Obg==', '4aeb0d1d2694f4fb03c0395e939bf326', '10q-HC1-3FJyMHWGvVj3eJgk874ZY1rHV'),
(48, 'Partnerships and Programs Associate ', 'REG_17342692093543', '<h3>Partnerships and Programs Associate&nbsp;</h3><p><strong>Job Title:</strong> Partnerships and Programs Manager<br><strong>Location:</strong>&nbsp;Ado-Ekiti,<br><strong>Department:</strong> Business Development<br><strong>Reports To:</strong> Director of Business Development<br>&nbsp;</p><p><strong>About McKodev Tech Lab:</strong><br>McKodev Tech Lab is a registered Web Development Agency committed to delivering outstanding results and high-quality solutions. We specialize in building innovative websites and digital solutions that help businesses grow and thrive in a digital world. Our ethos is centered around providing exceptional service and creating strong partnerships.<br>&nbsp;</p><p><strong>Position Overview:</strong><br>We are looking for an experienced and resourceful <strong>Partnerships and Programs&nbsp;</strong> <strong>Associate&nbsp;&nbsp;&nbsp;</strong>who will be responsible for identifying, developing, and managing strategic partnerships to drive business growth. This role involves building long-term relationships with potential clients, partners, and stakeholders. The person in this role will also play a key role in preparing, submitting, and responding to bids and proposals to secure new projects and opportunities for McKodev Tech Lab.<br>&nbsp;</p><p><strong>Key Responsibilities:</strong></p><ul><li>Develop and manage strategic partnerships that align with the company’s business goals.</li><li>Identify potential partners, including other agencies, businesses, and organizations, to drive collaboration and expansion.</li><li>Respond to RFPs (Requests for Proposals), RFQs (Requests for Quotes), and other bid requests by preparing comprehensive proposals and documentation.</li><li>Ensure bid submissions are tailored to client requirements and accurately reflect the company’s offerings.</li><li>Work closely with the leadership team to develop partnership strategies, negotiate contracts, and foster mutually beneficial relationships.</li><li>Maintain a pipeline of potential partnerships and regularly update the team on partnership status and opportunities.</li><li>Collaborate with internal teams to gather relevant information and expertise for proposals and bids.</li><li>Track and evaluate the success of partnership programs and initiatives, providing feedback for continuous improvement.</li><li>Participate in industry conferences, networking events, and client meetings to further build the company’s network and partnership opportunities.</li><li>Manage relationships with existing partners, ensuring that agreements are adhered to and partnership objectives are met.</li><li>Collaborate with marketing and sales teams to ensure brand consistency and effective communication of value propositions in proposals.</li></ul><p><strong>Qualifications:</strong></p><ul><li>Bachelor’s degree in Business, Marketing, or a related field (preferred).</li><li>A year of experience in partnership management, program development, or a similar business development role.</li><li>Strong knowledge of the web development or IT services industry.</li><li>Excellent skills in writing and presenting bids, proposals, and reports.</li><li>Proven ability to build relationships and manage negotiations effectively.</li><li>Strong organizational skills, with the ability to manage multiple projects simultaneously.</li><li>Self-motivated and able to work independently with a collaborative mindset.</li><li>Excellent verbal and written communication skills.</li></ul>', NULL, NULL, '2024/12/15/uploads/173426920840930DALL__E_2024_12_15_13.46.42___An_illustration_depicting_recruitment__featuring_diverse_professionals_in_a_modern_office_setting._A_hiring_manager_sits_at_a_desk_reviewing_resumes_w.webp', 'j90819542aBn72i', '01:26:49', '2024-12-15', '2024/12/15/uploads/173426920840930DALL__E_2024_12_15_13.46.42___An_illustration_depicting_recruitment__featuring_diverse_professionals_in_a_modern_office_setting._A_hiring_manager_sits_at_a_desk_reviewing_resumes_w.webp', 0, NULL, NULL, 'Mckodev Tech Lab', '<p>McKodev Tech Lab is a registered Web Development Agency committed to delivering outstanding results and high-quality solutions. We specialize in building innovative websites and digital solutions that help businesses grow and thrive in a digital world. Our ethos is centered around providing exceptional service and creating strong partnerships.</p>', NULL, NULL, 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2024-12-31', NULL, 50, NULL, NULL, 'ppa', NULL, NULL, 13, '', 'free', NULL, NULL, NULL, NULL, 'a:3:{s:68:\"QXJlIHlvdSBhIHJlY2VudCBncmFkdWF0ZSAoMS0yeXJzIHBvc3QgZ3JhZHVhdGlvbikg\";a:6:{s:2:\"id\";s:68:\"QXJlIHlvdSBhIHJlY2VudCBncmFkdWF0ZSAoMS0yeXJzIHBvc3QgZ3JhZHVhdGlvbikg\";s:8:\"question\";s:51:\"Are you a recent graduate (1-2yrs post graduation) \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:3:\"Yes\";i:1;s:2:\"No\";}s:8:\"required\";b:1;s:7:\"specify\";b:0;}s:12:\"TG9jYXRpb24=\";a:5:{s:2:\"id\";s:12:\"TG9jYXRpb24=\";s:8:\"question\";s:8:\"Location\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:56:\"Q1YgKFBsZWFzZSBzaG91bGQgbm90IGJlIG1vcmUgdGhhbiAxME1CKQ==\";a:5:{s:2:\"id\";s:56:\"Q1YgKFBsZWFzZSBzaG91bGQgbm90IGJlIG1vcmUgdGhhbiAxME1CKQ==\";s:8:\"question\";s:40:\"CV (Please should not be more than 10MB)\";s:4:\"type\";s:5:\"image\";s:7:\"options\";b:0;s:8:\"required\";b:1;}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Thank you for your registration. We woould reach out to you if sohortlisted for interview</p>', NULL, 'eK84s0nirKsuOzl+BSguAXCxo9v9df+J7UdDBOGLAtk/PVq7jjJMnP4X7ukpSwtDA/kJAQOYuR8JC3diI07lDCqvmrenIE5SmikF5Yeh0Hv0a9vzEQK+FQF/IUr/BRBeBppHdPbV2fo6v8NDfwbj3Q==', 'f45eb7af3bb6a0e1e51f51a6a7ac8f2e', '1RodFDR22YuTAarw6SiPVOfnx_na498rV');
